class ProfileComponent {
    constructor(userService, spinner, toastr) {
        this.userService = userService;
        this.spinner = spinner;
        this.toastr = toastr;
        this.section = 1;
        this.isChangePassword = false;
    }
    toggleChangePassword() {
        this.isChangePassword = !this.isChangePassword;
    }
    ngOnInit() {
        this.getProfileDetail();
    }
    continue() {
        if (this.section < 3) {
            this.section++;
        }
    }
    getProfileDetail() {
        this.spinner.show();
        this.userService.getUserDetail().subscribe((data) => {
            this.user = data;
            // this.toastr.success(data.message, 'Success');
            this.spinner.hide();
        }, (error) => {
            this.toastr.error(error.error.message, 'Error');
            this.spinner.hide();
        });
    }
    updateUser() {
        this.spinner.show();
        const obj = {
            firstName: this.user.firstName,
            middleName: this.user.middleName,
            lastName: this.user.lastName,
            city: this.user.city,
            state: this.user.state,
            country: this.user.country,
            postalCode: this.user.postalCode.toString(),
        };
        this.userService.updateUserDetail(obj).subscribe((data) => {
            // this.toastr.success(data.message, 'Success');
            this.spinner.hide();
        }, (error) => {
            this.toastr.error(error.error.message, 'Error');
            this.spinner.hide();
        });
    }
    updatePassword(event) {
        delete event.confirmPassword;
        this.spinner.show();
        this.userService.changePassword(event).subscribe((data) => {
            // this.toastr.success(data.message, 'Success');
            this.spinner.hide();
        }, (error) => {
            this.toastr.error(error.error.message, 'Error');
            this.spinner.hide();
        });
    }
}
